    false,nt"url": null,nt"notes": "The purpose of the Fisheries One-Stop-Shop
    (FOSS) is to make fisheries dependent information readily available to fisheries
    managers, scientists and the American public at a national as well as regional level.
     Collection and management of fisheries dependent data are distributed throughout
    NOAA Fisheries, State Fisheries, management agencies and regional Fisheries Information
    Networks (FINs).  The distributed nature of NOAA Fisheries information systems,
    differences in collection authorities and confidentiality requirements increases
    the importance of this flexible technical architecture that can meet the changing
    needs for information at national, regional and local levels of resolution.  At
    the same time, the technical architecture is scalable to meet enterprise wide requirements
    for management of other types of fisheries data and fisheries independent data.
    Currently available via FOSS are the summarized, non-confidential, annual Commercial
    Landings by state as provided through the Atlantic Coastal Cooperative Statistics
    Program (ACCSP), the Gulf of Mexico Fisheries Information Network (GulfFIN).  Recreational
    Landings estimates are available and provided via NMFS Headquarters.  In FY2011,
    FOSS will be expanded to include all commercial landings nationally.",nt"license_title":
